import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from './textfield';
import MenuItem from '@material-ui/core/MenuItem';

const players = async () => {
  try {
    const response = await fetch('http://localhost:5000/api/player/', {
      method: 'GET',
      headers: {
        'Content-Type': 'aplication/json'
      },
      body: JSON.stringify(),
    })
    const responseData = await response.json().body;
    console.log(responseData)
    return responseData;
  } catch (error) {
    console.log(error);
  }
}

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '15ch',
    },
  },
}));

export default function MultilineTextFields() {
  const [playersData, setPlayerData] = React.useState([]);
  const classes = useStyles();
  const [currency, setCurrency] = React.useState('EUR');
  const handleChange = (event) => {
    setCurrency(event.target.value);
  };

  const updatePlayersData = () => {
    setPlayerData(players());
    console.log(playersData);
  };

  return (
    <form className={classes.root} noValidate autoComplete="off">
      {updatePlayersData()}
      <div>
        {TextField(playersData[0].pokemons, handleChange)}
        {TextField(playersData[0].pokemons, handleChange)}
